const Todos = [
    {
        id: 1,
        title: "Take out the trash",
        completed: true
    },
    {
        id: 2,
        title: "Grocery shopping",
        completed: false
    },
    {
        id: 3,
        title: "Clean gecko tank",
        completed: false
    },
    {
        id: 4,
        title: "Mow lawn",
        completed: true
    },
    {
        id: 5,
        title: "Catch up on Arrested Development",
        completed: false
    }
]

export default Todos;
